        paddingTop: "5%",
        paddingBottom: "5%",
        }}>
      <Grid container item direction="column" xs={12} md={4}>
        <Grid item>
          <h2><ArticleIcon color="secondary" sx={{fontSize: "4rem", paddingRight: "1rem"}}/>Our News</h2>
